import Login from './componentsLogin/Login';
import Register from './componentsRegister/Register';
import { NavLink } from 'react-router-dom';
import './App.css';

export default class App extends Component {
  render() {
    return (
      <div className='App'>
        <NavLink exact to='/list'>
          ToDo List
        </NavLink>
        <NavLink exact to='/list'>
          ToDo List
        </NavLink>
        <Login />
        <Register />
      </div>
    );
  }
}
